import React from 'react'

export default class Pictures extends React.Component{
  render() {
    let pictures = [];
    this.props.pictures.forEach(pic => {
      pictures.push(
        <img
          src={require()}
        />
      );
    });
    return (
      <>
        {pictures}
      </>
    );
  }
}
